&quot;This week Cles is on the move all the way from Hollywood Blvd to Clearwater Beach. A couple girls in a store show us what they got for some bills, and a local skateboarder screams Money Talks while riding in his underwear. Then we go shopping and meet Jamie, who is willing to try on some lingerie for the right price, and gets really comfortable for us, feeling up all over her insane body!&quot;
